import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from 'react-router-dom';
import Home from './pages/Home';
import About from './pages/About';

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path='/' element={ <About /> } />
        <Route exact path='/' element={ <About /> } />
      </Routes>
    </Router>
  );
}

export default App;
